import { Outlet, Route, Routes } from "react-router-dom"
import { StudentHome } from '../StudentHome'

export const StudentsView = ({ user }) => {
    return (
        <Routes>
            <Route path="/" elemen={
                <Outlet />
            }>
                <Route index element={<StudentHome />} />
            </Route>
        </Routes>
    )
}
